import styled from 'styled-components';

export const StyledList = styled.div`
  width: 100%;
  margin-top: 20px;

  h2 {
    font-size: 1.4rem;
    font-weight: 600;
    color: ${({ theme }) => theme.colors.text};

    margin-left: 50px;
  }
`;
